script: |
  super -f text -I q12605.spq | sort > q12605.out

inputs:
  - name: q12605.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT + 82 BETWEEN 54 * + - 23 * - col0 AND 46;
  - name: tab2

outputs:
  - name: q12605.out
    data: |
      46	51	23
      64	77	40
      75	67	58
